        public NewCardPage()
        {
            InitializeComponent();
            IsLoading = false;
            BindingContext = this;
            ShowCards = false;
            ShowError = false;
            CameraButton.Clicked += CameraButton_Clicked;
            ErrorCameraButton.Clicked += CameraButton_Clicked;
            SaveButton.Clicked += SaveCard;
            //CancelButton.Clicked += Cancel;
            takePhoto();
        }

        private void GoBack()
        {
            Application.Current.MainPage.Navigation.PopAsync();
        }

        public void Cancel(object sender, EventArgs e)
        {
            GoBack();
        }

        private void CameraButton_Clicked(object sender, EventArgs e)
        {
            takePhoto();
        }

        public async Task<GiftcardItem> Post(Uri uri, Photo photoStream)
        {
            using (var client = new HttpClient())
            {
                var result = await client.PostAsync(uri, new StringContent(JsonConvert.SerializeObject(photoStream), Encoding.UTF8, "application/json"));
                var resultString = await result.Content.ReadAsStringAsync();
                return JsonConvert.DeserializeObject<GiftcardItem>(resultString);
            }
        }
        public async void SaveCard(object sender, EventArgs e)
        {

            if (await App.Database.GetItemAsync(GiftCard.Code) == null)
                await App.Database.SaveItemAsync(GiftCard);

            var list = await App.Database.GetItemsAsync();

            foreach (var l in list)
            {
                var q = l.Code;
            }
            GoBack();
        }

